import React from 'react'
import Navbar from "../components/Navbar";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';




const CssInputLabel = styled(TextField)({
  '& label.Mui-focused': {
    color: 'white',
  },
  '& .MuiInput-underline:after': {
    borderBottomColor: 'black',
  },
  '& .MuiOutlinedInput-root': {
    '& fieldset': {
      borderColor: 'white',
    },
    '&:hover fieldset': {
      borderColor: 'yellow',
    },
    '&.Mui-focused fieldset': {
      borderColor: 'black',
    },
  },
});



function PageSignUp() {

  const [rank, setRank] = React.useState('');

  const handleChange = (event) => {
    setRank(event.target.value);
  };


  return (
    <div>
        <Navbar />
        <Box sx={{height: '80vh',display: 'flex',justifyContent: 'center',alignItems:'center'}}>
            <Box sx={{ background: "#6592FD",width: "100%", maxWidth: 700,height: "100%",maxHeight: 500,top:'50%',left:'50%', borderRadius: "10px", borderStyle: "solid",}}>
                <Box sx={{textAlign: 'center'}}>
                <Typography
              variant="subtitle1"
              sx={{ color: "#ffffff", fontWeight: "bold", fontSize: "24px" }}
            >
              Sign up
            </Typography>
                </Box>
                <Box sx={{display: "flex",justifyContent:'center',alignItems: 'center',flexDirection:'column'}}>
                <Box sx={{ minWidth: 500 }}>
      <FormControl fullWidth>
        <InputLabel id="demo-simple-select-label">ยศ</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={rank}
          label="ยศ"
          onChange={handleChange}
        >
          <MenuItem value={10}>จ.ต.</MenuItem>
          <MenuItem value={20}>จ.ท.</MenuItem>
          <MenuItem value={30}>จ.อ.</MenuItem>
        </Select>
      </FormControl>
    </Box>
</Box>
            </Box>
        </Box>
    </div>
  )
}

export default PageSignUp
